/**
 * This file defines a large associative array called $CCV_CONST that
 * contains all the predefined values used in different sections of the
 * CCV. For example, whenever the CCV contains a field with a yes/no
 * type, it uses the constant "00000000000000000000000000000400" to
 * encode "yes", and "00000000000000000000000000000401" to encode "no".
 * Rather than hard-coding these constants in your scripts to query the
 * CV data, use this array, i.e. refer to "yes" by using
 * $CCV_CONST["Yes-No"]["Yes"], etc.
 *
 * The array has two dimensions; the first coordinate is the name of
 * the type (e.g. "Academic Position Type") and the second is one of the
 * allowed values for that type (e.g. "Assistant Professor"). This
 * information was automatically transferred from the human-readable list
 * of values available here: 
 *
 * Please note that the CommonCV class offers you a method to reverse the
 * lookup and get back the caption (e.g. "Assitant Professor") from the
 * value ("00000000000000000000000000000002" in that case).
 */
